sys_variable_value.value:
(function execute(inputs, outputs) {
    var successCodes = ['200', '202', '201'];
    var arrayUtil = new global.ArrayUtil();
    var response = JSON.parse(inputs.response_body);
    if (arrayUtil.contains(successCodes, inputs.status)) {
        outputs.status = 'Success';
        var endpoint = {};
        if (response.name)
            endpoint.name = response.name;
        var properties = {};
        if (response.properties.endpointStatus)
            properties.endpoint_status = response.properties.endpointStatus;
        if (response.properties.endpointMonitorStatus)
            properties.endpoint_monitor_status = response.properties.endpointMonitorStatus;
        if (response.properties.target)
            properties.target = response.properties.target;
        if (response.properties.priority)
            properties.priority = response.properties.priority;
        if (response.properties.weight)
            properties.weight = response.properties.weight;
        if (response.properties.endpointLocation)
            properties.endpoint_location = response.properties.endpointLocation;
        if (response.properties.geoMappings) {
            var geoMappings = [];
            for (map in response.properties.geoMappings) {
                geoMappings.push(response.properties.geoMappings[map]);
            }
            properties.geo_mappings = geoMappings;
        }
        if (response.properties.subnets) {
            var subnets = response.properties.subnets;
            var subnet = subnets[0].first + "/" + subnets[0].scope + "," + subnets[1].first + "-" + subnets[1].last;
            gs.info(subnet);
            properties.subnet = subnet;
        }
        if (response.properties.customHeaders) {
            var headers = [];
            for (headerIndex in response.properties.customHeaders) {
                var header = {};
                header.name = response.properties.customHeaders[headerIndex].name;
                header.value = response.properties.customHeaders[headerIndex].value;
            }
            headers.push(header);
        }
        if (headers)
            properties.custom_headers = headers
        endpoint.properties = properties;
        outputs.endpoint = endpoint;
    } else {
        outputs.status = 'Error';
        if (response.error)
            outputs.error_message = response.error.message;
        else
            outputs.error_message = response.message;
    }
})(inputs, outputs);

